Sky point villa in #newyorkusa🇺🇸 
#bedford hills
(initial Concept design )
As you can see, the original design of the villa for a family in New York, in a pleasant climate #bedford hills.
It is for a family of three.
The design of Skypoint Villa is based on the original design of Black Villa. The skylights along the villa as well as the sloping roof make it more attractive.
The entrance is from above and down by stairs and elevators because the slope of the ground is to the south.
The green roof covering and the color of black concrete make the nature of the villa more attractive.  #newyorkusa🇺🇸 city #america 

Architect: Reza Mohtashami
Location: #newyork in #america
