Black brick

Villa design of our new project in Tehran - Iran 
For a family with a modern mind .
The initial idea is based on the wishes of the client (@mahinbanoo.ir )and also the location of the project in the Damavand area and in a green garden among the fruit trees on the south side of the villa with large windows that fully view the garden.
The north side of the villa had to be enclosed from a neighborhood view due to the client request.
The color of black brick will double the Attractive of the green space.

Best Regards 

